// src/main.js
import React from "react";
import { Layout, Progress, Calendar, Avatar } from "antd";
//import "antd/dist/antd.css";

const { Header, Content, Footer } = Layout;

const Main = () => {
  return (
    <Layout>
      <Header
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
        }}
      >
        <div style={{ color: "white", fontSize: "24px" }}>Wanted 66</div>
        <Avatar
          style={{ backgroundColor: "transparent" }}
          icon={<img src="path/to/bell-icon.png" alt="bell icon" />}
        />
      </Header>
      <Content style={{ padding: "0 50px", marginTop: "20px" }}>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            marginBottom: "20px",
          }}
        >
          <Avatar.Group maxCount={5}>
            <Avatar src="path/to/avatar1.png" />
            <Avatar src="path/to/avatar2.png" />
            <Avatar src="path/to/avatar3.png" />
            <Avatar src="path/to/avatar4.png" />
            <Avatar src="path/to/avatar5.png" />
          </Avatar.Group>
        </div>
        <div style={{ textAlign: "center", marginBottom: "20px" }}>
          달성까지 D-Day
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            marginBottom: "20px",
          }}
        >
          <Progress percent={80} showInfo={false} />
        </div>
        <Calendar
          fullscreen={false}
          style={{ margin: "0 auto", maxWidth: "400px" }}
        />
        <div style={{ textAlign: "center", marginTop: "20px" }}>
          사람들은 동기 부여는 오래가지 않는다고 말한다.
          <br />
          목욕도 마찬가지다. 그래서 매일 하라고 하는 것이다.
          <br />- 지그 지글러 -
        </div>
      </Content>
      <Footer style={{ textAlign: "center" }}>66</Footer>
    </Layout>
  );
};

export default Main;
